import React from "react";
import Slider from "react-slick";
import "slick-carousel/slick/slick.css";
import "slick-carousel/slick/slick-theme.css";
import ListItem from "../components/ListItem";

const FirstSection = ({ data }) => {
    const setting = {
        dots: true,
        infinite: true,
        speed: 500,
        slidesToShow: 1,
        slidesToScroll: 1,
        centerMode: true,
        autoplay: true,
        pauseOnHover: true,
        centerMode: true,
    };

    return (
        <div className=" mb-13 bg-slate-400 ">
            <Slider {...setting}>
                {data.map((data) => (
                    <ListItem data={data} />
                ))}
            </Slider>
        </div>
    );
};

export default FirstSection;
